// import logo from './logo.svg';
import '../App.css';
import Banner from '.Banner'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          La maison Jungle
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
